import React from "react";
import articleContent from "./article-content";
import { Link } from "react-router-dom";

const ArticleList = () => {
  return (
    <React.Fragment>
      <h1>Article List</h1>
      {articleContent.map((i, article) => (
        <Link to="/article/{article.name}"></Link>
      ))}
    </React.Fragment>
  );
};

export default ArticleList;
